import React from "react";

export default function Textform(props) {
  return (
    <div>
      <div className="form-floating">
        <textarea
          className="form-control"
          placeholder="Leave a text here"
          id="mybox"
        ></textarea>
        <label for="floatingTextarea">{props.heading}</label>
      </div>
    </div>
  );
}
